import React from 'react';
import "./static/css/App.css"
import { route } from "./router/index"
import { Switch } from "antd"
import { Route } from "react-router-dom"
function App() {
  return (

    <div>
       <Switch>

         {route.map((item,index)=>{
           return <Route 
            key={index}
            path= { item.path}
           />
         })


         }
       </Switch>
    </div>
    );
}

export default App;
